  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Denominator File combines Medicare
  beneficiary entitlement status information from administrative enrollment records
  with third-party payer information and GHP enrollment information. The Denominator
  File contains data on all Medicare beneficiaries enrolled and or entitled in a given
  year. It is an abbreviated version of the Enrollment Data Base (EDB) (selected data
  elements). It does not contain data on all beneficiaries ever entitled to Medicare.
  The file contains data only for beneficiaries who were entitled during the year
  of the data. These data are available annually in May of the current year for the
  prior year.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
